import React from "react";
import Navbar from "./compo/navbar";
import Herosection from "./compo/herosection";

const Portfolio = () => {
  return (
    <div className="PortBody">
      <div id="home">
      
        <Navbar />
        <Herosection />
      </div>
    </div>
  );
};

export default Portfolio;
